import React from 'react';


function ServiceCatagoryCard(props){
	return(
		<div className='ServiceCatagoryCard'>
			<div onClick={console.alert('ServiceCatagoryCard clicked')}>
				<img src='#' alt='Salon'/>
				<div>
					<h3>{props.Name} salon</h3>
					<p>{props.Description} Description will be here</p>
				</div>
			</div>
		</div>
	);
}

export default ServiceCatagoryCard;
